import React, { useState } from 'react'

export default function App() {
  const [count, setCount] = useState(0)

  function decrementCount(){
    setCount(prevCount => prevCount -1)
  }



  return (
    <div>
      <button onClick={decrementCount}>-</button>
      <span>{count}</span>
      <button>+</button>
    </div>
  )
}
